import './App.css';
import Header from './components/header';
import AddTimeTable from './components/addtimetable';
import {BrowserRouter as Router,Route} from 'react-router-dom'

function App() {
  return (
    <Router>
    <div>
    <Route path="/add" exact component = {AddTimeTable}/>

    </div>

    </Router>
  );
}

export default App;
